import { PipelineToolbar } from './toolbar';
import { PipelineUI } from './ui';
import { SubmitButton } from './submit';
import { TooltipProvider } from './components/ui/tooltip';

function App() {
  return (
    <TooltipProvider>
      <div className="h-screen flex flex-col bg-background">
        {/* Header with toolbar and submit button */}
        <header className="flex items-center justify-between border-b border-border bg-white">
          <PipelineToolbar />
          <div className="px-4">
            <SubmitButton />
          </div>
        </header>

        {/* Main canvas area */}
        <main className="flex-1 overflow-hidden">
          <PipelineUI />
        </main>
      </div>
    </TooltipProvider>
  );
}

export default App;
